const executions = $input.all();

let successCount = 0;
let errorCount = 0;
let totalDuration = 0;

executions.forEach(execution => {
  if (execution.json.finished) {
    const startedAt = new Date(execution.json.startedAt);
    const stoppedAt = new Date(execution.json.stoppedAt);
    const duration = (stoppedAt - startedAt) / 1000; // Duración en segundos

    // Inferir el estado de la ejecución
    if (execution.json.error) { // Si hay un campo "error", la ejecución falló
      errorCount++;
    } else { // Si no hay un campo "error", la ejecución fue exitosa
      successCount++;
    }

    // Sumar la duración total
    totalDuration += duration;
  }
});

// Generar el resumen en formato HTML
const summaryHTML = `
<!DOCTYPE html>
<html lang="es">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Resumen de Ejecuciones</title>
  <style>
    body {
      font-family: Arial, sans-serif;
      background-color: #f4f4f4;
      margin: 0;
      padding: 0;
    }
    .container {
      max-width: 600px;
      margin: 20px auto;
      background-color: #ffffff;
      border-radius: 8px;
      box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
      overflow: hidden;
    }
    .header {
      background-color: #007bff;
      color: #ffffff;
      padding: 20px;
      text-align: center;
    }
    .header h1 {
      margin: 0;
      font-size: 24px;
    }
    .content {
      padding: 20px;
      color: #333333;
    }
    .content h2 {
      font-size: 20px;
      margin-top: 0;
    }
    .content p {
      font-size: 16px;
      line-height: 1.6;
    }
    .stats {
      background-color: #f9f9f9;
      padding: 15px;
      border-radius: 8px;
      margin-top: 20px;
    }
    .stats p {
      margin: 10px 0;
      font-size: 16px;
    }
    .footer {
      text-align: center;
      padding: 10px;
      background-color: #f1f1f1;
      font-size: 14px;
      color: #666666;
    }
  </style>
</head>
<body>
  <div class="container">
    <!-- Encabezado -->
    <div class="header">
      <h1>Resumen de Ejecuciones del Día</h1>
    </div>

    <!-- Contenido -->
    <div class="content">
      <h2>¡Hola!</h2>
      <p>Aquí tienes un resumen de las ejecuciones realizadas hoy:</p>

      <!-- Estadísticas -->
      <div class="stats">
        <p><strong>Ejecuciones exitosas:</strong> ${successCount}</p>
        <p><strong>Ejecuciones fallidas:</strong> ${errorCount}</p>
        <p><strong>Duración total:</strong> ${totalDuration.toFixed(2)} segundos</p>
      </div>

      <p>Gracias por utilizar nuestro servicio. ¡Que tengas un excelente día!</p>
    </div>

    <!-- Pie de página -->
    <div class="footer">
      <p>Este es un mensaje automático. Por favor, no respondas a este correo.</p>
    </div>
  </div>
</body>
</html>
`;

// Devolver el resumen en formato HTML
return [{ json: { summaryHTML } }];
